import { Box, Heading, Divider } from "@chakra-ui/react"

function Title() {
    return (
        <Box p={1}>
            <Heading as="h1" noOfLines={1}>
                Todo List
            </Heading>
            <Divider />
        </Box>
    );
}

export default Title
